import ExpenseItem from "./ExpenseItem";

function Expenses (props) {
    const {props: expenses} = props;

    const expensesList = expenses.map((expense) => expense);

    console.table(expensesList.amount.number);

    return (
        <ExpenseItem title={expense.title}
        date={expense.date}
        amount={expense.amount}
        />
    )
}

export default Expenses;
